cryptoTests :: Test
cryptoTests =
  testGroup "Crypto tests" [
    testGroup "Hash tests" (
       encodeSHATests "SHA-1"
        sha1 sha1_spec_tests sha1_nist_tests
    ++ encodeSHATests "SHA-1 Lazy"
        sha1lazy sha1_spec_tests sha1_nist_tests
    ++ encodeSHATests "SHA-256"
        sha256 sha256_spec_tests sha256_nist_tests
    ++ encodeSHATests "SHA-256 Lazy"
        sha256lazy sha256_spec_tests sha256_nist_tests
    )
  , testGroup "RSA certificate hashing tests" (
    )
  ]

-- These tests are stolen from my SHA library. Wheeee!

encodeSHATests :: ByteStringType a =>
                  String -> (a -> a) ->
                  [(String, String)] ->
                  [(String, String)] ->
                  [Test]
encodeSHATests _      _   []       []   = []
encodeSHATests verStr sha (x:spec) nist =
  buildSHATest verStr "specification" sha x :
  encodeSHATests verStr sha spec nist
encodeSHATests verStr sha []       (x:rest) =
  buildSHATest verStr "NIST" sha x :
  encodeSHATests verStr sha [] rest

buildSHATest :: ByteStringType a =>
                String -> String -> (a -> a) -> (String, String) ->
                Test
buildSHATest ver kind hash (input, output) =
  testCase tname (assertEqual tname (hash inputBS) outputBS)
 where
  tname    = ver ++ " (from " ++ kind ++ ")"
  decoder  = if kind == "NIST" then nist_decode else spec_decode
  inputBS  = decoder input
  outputBS = nist_decode output

