class (Eq a, Show a) => ByteStringType a where
  doPack :: [Word8] -> a

instance ByteStringType S.ByteString where doPack = S.pack
instance ByteStringType L.ByteString where doPack = L.pack

spec_decode :: ByteStringType a => String -> a
spec_decode = doPack . map (fromIntegral . ord)

nist_decode :: ByteStringType a => String -> a
nist_decode inst = doPack $ map toByte $ groupBy2 inst
 where
  toByte [a,b] = (toVal a `shiftL` 4) + toVal b
  toByte _ = error "groupBy2 didn't work"
  --
  groupBy2 [] = []
  groupBy2 (a:b:rest) = [a,b]:groupBy2 rest
  groupBy2 _ = error "Uneven list to groupBy2"
  --
  toVal '0' = 0
  toVal '1' = 1
  toVal '2' = 2
  toVal '3' = 3
  toVal '4' = 4
  toVal '5' = 5
  toVal '6' = 6
  toVal '7' = 7
